import React from "react";

const UserCard = () => {
  return (
    <>
      <div class="card">
        <header class="card-personal-header">
          <h1 class="card-personal-name">Solus Verhen</h1>
          <a href="/" class="card-personal-link">
            @solusVerhen
          </a>
          <p class="card-personal-description">
            writing my first book Freelancer writer and blog.
          </p>
        </header>
        <section class="card-personal-info">
          <a href="/">
            <span>9k</span> followers
          </a>
          <a href="/">
            <span>520</span> following
          </a>
        </section>
      </div>
    </>
  );
};
export default UserCard;
